    const getAll=()=>{

            axios.get("http://localhost:8080/login", {
            }).then((res) => {

                console.log(res)
                a=res.data
               console.log(a)

            }).catch(function (error) {
                // handle error
                console.log(error);
            })

    }

    return(
        <div>
            {getAll()}
